member.example:
The ActiveButton class can be used to create new
button instances, which can be added to the current IActiveMenu. The
Height and Width properties of the button class are auto-configured 
based on the current platform and theme.

	// get an instance of the menu for the current form
	IActiveMenu menu = ActiveMenu.GetInstance(this);

	// create a new instance of ActiveButton
	ActiveButton button = new ActiveButton();

	// set the button properties
	button.Text = "One";
	button.BackColor = Color.Red;

	// attach button event handlers
	button.Click += new EventHandler(button_Click);

	// add the button to the title bar menu
	menu.Items.Add(button);

This sample shows how to get an instance of the IActiveMenu and
render an instance of a button in the title bar.

	// get an instance of the menu for the current form
	IActiveMenu menu = ActiveMenu.GetInstance(this);

	// create a new instance of ActiveButton
	ActiveButton button = new ActiveButton();
	button.Text = "One";
	button.BackColor = Color.Blue;
	button.Click += new EventHandler(button_Click);

	// add the button to the title bar menu
	menu.Items.Add(button);

This sample shows how to add & remove buttons form the IActiveMenu
using the Items list.

	// get an instance of the menu for the current form
	IActiveMenu menu = ActiveMenu.GetInstance(this);

	// add button to front the menu
	menu.Items.Add(button);

	// insert button at position 2
	menu.Items.Insert(2, button);

	// remove specific button
	menu.Remove(button);

	// remove button at position 2
	menu.RemoveAt(2);
